window.addEventListener("load",(function(){let editButtons;document.querySelectorAll(".icon-checkbox-checked").forEach((function(button){button.addEventListener("click",event=>{let currentlySelected=document.querySelector("tr.bg-selected"),contactsTable;null!=currentlySelected&&currentlySelected.classList.remove("bg-selected"),button.parentNode.parentNode.classList.add("bg-selected"),document.querySelector("#ContactsTable").style.display="block"})}))}));